import { Component, Vue } from 'vue-property-decorator';
import { VMoney } from 'v-money';

import shippingService from '@/services/shipping.service';

@Component({
    directives: { money: VMoney },
})
export class freteView extends Vue {
    private shippingService = new shippingService();

    acombinar: boolean = false;
    noFee: boolean = false;
    takeAway: boolean = false;
    chargeFee: boolean = true;
    furtherAgreement: boolean = false;
    deliveryTime: any = '01:00:00';
    minimumPrice: string | number = '';
    minimumMoneyConfig: any = {
        decimal: '.',
        thousands: ',',
        prefix: 'R$ ',
        precision: 2,
        masked: true,
    };
    feePrice: string | number = '';
    feePriceError: boolean | string = false;
    feeMoneyConfig: any = {
        decimal: '.',
        thousands: ',',
        prefix: 'R$ ',
        precision: 2,
        masked: true,
    };
    public loggedUser: any;


    constructor() {
        super();
        const logged: any = localStorage.getItem('loggedUser');
        this.loggedUser = JSON.parse(logged);
    }

    mounted() {
        this.shippingService.getShippingDetail(this.loggedUser.slug)
            .then(data => {
                if (data.ok) {
                    data.json().then(shipping => {
                        this.takeAway = (shipping.takeaway === true) ? shipping.takeaway : false;
                        this.furtherAgreement = (shipping.further_agreement === false) ? shipping.further_agreement : true;
                        this.chargeFee = (shipping.charge_shipping === true) ? shipping.charge_shipping : false;
                        this.noFee = (shipping.free_shipping === true) ? shipping.free_shipping : false;
                        this.feePrice = shipping.price;
                        this.minimumPrice = shipping.minimum_price;
                        this.deliveryTime = (shipping.estimated_time === null) ? '00:00:00' : shipping.estimated_time;
                    });
                }
            });
    }

    validateCurrency(x) {
        let money;
        if (x) {
            money = x.replace('R$ ', '');
            money = money.replace(',', '');
        }
        return money;
    }

    createShipping() {
        this.feePrice = this.validateCurrency(this.feePrice);
        this.minimumPrice = this.validateCurrency(this.minimumPrice);
        const shippingDetails = {
            price: this.feePrice,
            minimum_price: this.minimumPrice,
            takeaway: this.takeAway,
            further_agreement: this.furtherAgreement,
            estimated_time: this.deliveryTime,
            free_shipping: this.noFee,
            charge_shipping: this.chargeFee,
        };

        // if ((this.chargeFee && this.noFee) || (!this.chargeFee && !this.noFee)) {
        //     this.$emit('notification', {
        //         icon: require('./../../../assets/images/icon_error.png'),
        //         text: 'Você deve selecionar ao menos uma opção de <b>Frete</b>',
        //         color: '#ffd1c4',
        //         active: true,
        //         type: 'error',
        //     });

        //     return
        // }

        if (this.feePrice > 0 && this.chargeFee) {
            this.feePriceError = false;
            this.shippingService.createShipping(shippingDetails, this.loggedUser.slug)
                .then(data => {
                    if (data.ok) {
                        this.$emit('notification', {
                            icon: require('./../../../assets/images/icon_chat.png'),
                            text: `Alterações salvas com sucesso`,
                            color: '#c3e4e7',
                            active: true,
                            type: 'error',
                        });
                    } else {
                        this.$emit('notification', {
                            icon: require('./../../../assets/images/icon_error.png'),
                            text: 'Por favor preencha o tempo médio de entrega',
                            color: '#ffd1c4',
                            active: true,
                            type: 'error',
                        });
                    }
                });
        } else if (!this.chargeFee) {
            this.feePriceError = false;
            this.shippingService.createShipping(shippingDetails, this.loggedUser.slug)
                .then(data => {
                    if (data.ok) {
                        this.$emit('notification', {
                            icon: require('./../../../assets/images/icon_chat.png'),
                            text: `Alterações salvas com sucesso`,
                            color: '#c3e4e7',
                            active: true,
                            type: 'error',
                        });
                    } else {
                        this.$emit('notification', {
                            icon: require('./../../../assets/images/icon_error.png'),
                            text: 'Por favor preencha o tempo médio de entrega',
                            color: '#ffd1c4',
                            active: true,
                            type: 'error',
                        });
                    }
                });
        } else if (this.chargeFee) {
            this.feePriceError = 'Defina um valor ao frete.';
        }

    }
}
